import React from 'react';
import './SolutionPage.css';

const SolutionPage = () => (
  <div className="solution-details-root">
    {/* Navigation */}
    <div className="solution-details-navigation">
      <svg className="solution-details-logo" width="306" height="65" viewBox="0 0 306 65" fill="none" xmlns="http://www.w3.org/2000/svg">
        {/* ...SVG paths略，建议用原有logoSVG... */}
      </svg>
      <div className="solution-details-items">
        <span>About Solution Contract vehicels Employee portal Careers News</span>
        <button className="solution-details-contract-btn">
          <span>Contract</span>
        </button>
      </div>
    </div>
    {/* Banner */}
    <div className="solution-details-banner-bg" />
    <div className="solution-details-banner-title">Data Analytics & AI/ML</div>
    <div className="solution-details-return">
      <span>RETUREN TO SERVICE</span>
      <svg className="solution-details-return-icon" width="47" height="55" viewBox="0 0 47 55" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M17.625 41.25L5.875 27.5L17.625 13.75L20.3667 16.9583L13.3167 25.2083H37.2083V16.0417H41.125V29.7917H13.3167L20.3667 38.0417L17.625 41.25Z" fill="white"/>
      </svg>
    </div>
    {/* 其他区块可继续补充... */}
  </div>
);

export default SolutionPage;
